const cars = [
  {
    model: "Honda Civic",
    coloursByPopularity: ["black", "silver"],
    speedStats: {
      topSpeed: 125,      // Actual top speed for a Honda Civic
      zeroToSixty: 7.5    // Actual 0-60 time for a Honda Civic
    }
  },
  {
    model: "Tesla Model 3",
    coloursByPopularity: ["red", "white"],
    speedStats: {
      topSpeed: 162,      // Actual top speed for a Tesla Model 3
      zeroToSixty: 3.1    // Actual 0-60 time for a Tesla Model 3
    }
  }
];

export default cars;
